New Year, New Cut! @beautybysammieyeo absolutely killed it and gave me *exactly* what i wanted without me doing a good job explaining…. 

This year you’ll see me more active with posts on this page. I’ll be sharing everything from my face, my team, leadership and of course, rainbow hair. If you have followed me closely, you know i post a ton on my stories… but i feel that it’s time to bring it to my actual feed. Also a lot is going on behind the scenes with @dangerjonescreative which i will also share!

I’ve started my new role in the salon which is barely being behind the chair, and actually getting to mentor and be a manager/owner. I can’t wait to share this journey with you all and i hope this page can bring some inside looks at salon ownership. The good, the hard, and everything in between!


Also, Shout out to the army of humans that keep me looking human 😂 i haven’t worn makeup since 2020 and it wouldn’t be possible without these women:

