✨Vivid Curls Transformation ✨

✨This was not an easy transformation. We had level 3/4 natural roots, with banding, and light ends on fragile hair. The absolute last thing we wanted to do was compromise @theamaraofficial killer curl pattern. I think we did a pretty good job on this one ☺️ 

✨ @hair_princess_steph said it best on her posts from this collab - and I can’t agree more. I’m super grateful for the education I’ve been receiving for all the curl types. And I’m super excited for continued growth and knowledge on ALL textures. The joy in Amaras face when we finished her transformation was one of the most rewarding feelings behind the chair I’ve felt to date. This job rocks.

🖌Color and blonding Collab: @jdoblehair + @hair_princess_steph 
